import React, { Component } from "react";

export default class Menu extends Component {
  render() {
    const menu = this.props.dishes.map(dish => {
      return (
        <div>
          <Card>
            <CardImg>{dish.image}</CardImg>
            <CardBody>
              <CardTitle>{dish.title}</CardTitle>
            </CardBody>
          </Card>
        </div>
      );
    });
    return <div>{menu}</div>;
  }
}
